import './LastPage.scss';
import logo from '../images/last-image.png'
import '../../components/button/Button.scss';
import '../../components/navbar/NavBar.scss';
import '../../components/footer/Footer.scss';
import Button from '../../components/button/Button';
import Footer from '../../components/footer/Footer';
import NavBar from '../../components/navbar/Navbar';
import { useNavigate } from 'react-router-dom'

function LastPage() {

  const navigate = useNavigate();

  const routerButton = () =>{
      navigate('/introduction');  

      <img className="last-image" src={logo} alt="imagem de agradecimento"/>
  };

  return (
    <div className="last-page-containe">
    <div className="navBar-complete">
      <NavBar classNav="nav-container-percentage-bar"/>
    </div>

      <img className="last-image" src={logo} alt="imagem de agradecimento"/>

      <div className="form-container">
      <h1 className="title">
          Olá! Ajude-nos com nossa pesquisa de engajamento.
        </h1>
      </div>      

  <div className="footer">
    <Footer nameBtn="Próximo" classFooter="footer-container-static2"/>
  </div>

</div>     
  );
}

export default LastPage;
